#include <stdio.h>
#include <stdlib.h>
#include <assert.h>
#include <utility>

template <typename T>
struct Vector
{
  Vector() : size(0), capacity(0), ptr(nullptr) {}

  ~Vector()
  {
    free(ptr);
    printf("Freed: %zu Bytes", sizeof(T) * size);
  }

  T& operator[](size_t index)
  {
    assert(index < size);
    return ptr[index];
  }

  const T& operator[](size_t index) const
  {
    assert(index < size);
    return ptr[index];
  }

  void push_back(const T& value)
  {
    if (size == capacity)
      reserve(capacity ? capacity * 2 : 8);

    ptr[size++] = value;
  }

  template <typename... Args>
  void emplace_back(Args&& ...args)
  {
    if (size == capacity)
      reserve(capacity ? capacity * 2 : 8);

    ptr[size++] = std::move(std::forward<Args>(args)...);
  }

  void reserve(size_t cap)
  {
    capacity = cap;

    T *tmp_ptr = static_cast<T*>(malloc(capacity * sizeof(T)));
    assert(tmp_ptr != nullptr);

    for (size_t i = 0; i < size; ++i)
      tmp_ptr[i] = ptr[i];

    free(ptr);
    ptr = tmp_ptr;
  }

  // number of elements in the vector
  size_t size;
  // size of the currently allocated memory
  size_t capacity;
  // pointer to the allocated memory
  T* ptr;
};

int main()
{
  Vector<int> v;

  v.push_back(3);
  v.push_back(4);
  v.emplace_back(5);
  v.emplace_back(6);

  for (size_t i = 10; i < 30; ++i)
    v.push_back(i);

  for (size_t i = 30; i < 50; ++i)
    v.push_back(i);

  printf("%d \n%d \n%d \n%d \n%d \n%d \nSize: %zu \nCapacity: %zu \n", v[0], v[1], v[2], v[3], v[39], v[40], v.size, v.capacity);
}

