func Swap(a MatrixQ, i int, b []Q) MatrixQ {

	var c MatrixQ

	for i := 0; i < len(a); i++ {
		temp := make([]Q, len(a))
		for j := 0; j < len(a); j++ {
			temp[j] = a[i][j]
		}
		c = append(c, temp)
	}

	for k := 0; k < len(a); k++ {
		c[k][i] = b[k]
	}

	return c
}

func Solve(a MatrixQ, b []Q) ([]Q, error) {
	det := Determinant(a)

	if det.M == 0 {
		return nil, ErrNotPossibleToSolve
	}

	result := make([]Q, 0, len(b))

	for i := 0; i < len(a); i++ {
		temp := Swap(a, i, b)
		result = append(result, Div(Determinant(temp), det))
	}

	return result, nil
}

package equations

import (
	"fmt"
	"log"
	"motk/internal/math/gcd"
)

func Add(a, b Q) Q {
	b.M = a.M*b.N + a.N*b.M
	b.N = a.N * b.N
	return simplify(b)
}

func Sub(a, b Q) Q {
	b.M *= -1
	return Add(a, b)
}

func Mult(a, b Q) Q {
	a.M *= b.M
	a.N *= b.N
	return simplify(a)
}

func Div(a, b Q) Q {
	b.M, b.N = b.N, b.M
	return Mult(a, b)
}

func (q Q) String() string {
	return fmt.Sprintf("%v/%v", q.M, q.N)
}

func simplify(q Q) Q {
	if q.N < 0 {
		q.M *= -1
		q.N *= -1
	}

	div, err := gcd.Euclid(q.M, q.N)
	if err != nil {
		log.Fatalf("Failed simplify number: %v", q)
	}

	q.M /= div
	q.N /= div
	return q
}

